import React from 'react'
import './landingpage.css'
import Phone from '../assets/portfolio-20201008.jpeg'

const Main = () => {
    return(
        <div>
            <div className="robo900 main-title">SimBull - The Stock Market for Sports</div>
            <div><img src={Phone} alt='web-app-example' /></div>
        </div>
    )
}

export default Main
